}

contract Project {
    uint id;
    string name;
    uint goal;
    bool archive;
    uint created;
    address owner;

    constructor(string memory _name, uint _goal, address _owner) {
        id = 1; // random
        name = _name;
        goal = _goal;
        archive = false;
        created = block.timestamp;
        owner = _owner;
    }
}


